import React from 'react'
class Places extends  React.Component{
    constructor() {
        super();
        this.state = {
            isLoaded :false
        }
        let data = {};

    }
    render(){
        return (
            <div>
                {()=>{
                    if (!this.state.isLoaded)
                    {
                        fetch("http://localhost:3001/customRequest/Select%20*%20from%20places%20where%20id%3C3").then(
                            (response)=>{
                                this.state.isLoaded = true;
                                response.json().then((resp)=>{data = resp})
                            },
                            (reject)=>{
                                console.log(reject)
                            }
                        )
                        return "Loading..."
                    }
                    else {
                        return this.state.data.toString()
                    }

                }}
            </div>
        )
    }
}
export default Places
